import React from 'react';
import s from './Friends.module.css';

const Friends = (props) => {
    return (
        (<div>
        <div className = {s.item}>
        My friends
    </div>
    <div className = {s.ava}>
           <img src = 'https://cdnimg.rg.ru/img/content/177/18/63/1000s_d_850.jpg' />
    </div>
    </div>
    )
    );
}

export default Friends;
